import Card from "../layout/Card";
import './Home-Page.scss';

import bgImg from '../../assets/screen-shot-2019-01-06-at-10-56-44.png'

const HomePage = () => {
  return (
    <div className="cont">
      <Card>
          <p>Epicure works with the top chef restaurants in Tel Aviv</p>
      </Card>
    </div>
  );
};

export default HomePage;
